getPSControlLogics.scriptCode:
const searchform= view.getCtrl("SEARCHFORM", "searchform");
const activectrl = view.getCtrl("GRID", "grid1");
const activectrl2 = view.getCtrl("GRID","grid2");
activectrl.params = searchform.getFilterParams();
activectrl2.params = searchform.getFilterParams();
activectrl.refresh();
activectrl2.refresh();

