  infos = data.candidates[0].job_name || '';
}
return infos;

let user_list = data.candidates || [];
let feedback_list = data.hr_interview_feedbacks || [];
let infos = '';
if (user_list.length === 1 && feedback_list.length > 0) {
    const app2 = ibiz.hub.getApp(context.srfappid);
    const dataItems = await app2.codeList.get("web.hr__interview_result_type", context, params);
    feedback_list.forEach(detail => {
        let info = "";
        const item = dataItems.find(x => x.value === detail.result_type);
        if (item && item.sysImage) {
             info = '<div class="ibiz-code-list__item" style="height: 36px;line-height: 36px;"><div class="ibiz-icon" style="height: 100%;padding-right: 8px;">' + item.sysImage.rawContent + '</div>' + detail.interviewer_name + '</div>';
             infos += info;
        }
    });
}
return infos;

